import React from 'react';
import './TeknikKonular.css';

const TeknikKonular: React.FC = () => {
  return (
    <div className="teknik-konular">
      <h1>Teknik Konular</h1>
      <div className="content">
        <section>
          <h2>Yazılım Geliştirme</h2>
          <ul>
            <li>Web Geliştirme</li>
            <li>Mobil Uygulama Geliştirme</li>
            <li>Veritabanı Yönetimi</li>
          </ul>
        </section>

        <section>
          <h2>Sistem ve Ağ</h2>
          <ul>
            <li>Ağ Güvenliği</li>
            <li>Sunucu Yönetimi</li>
            <li>Cloud Computing</li>
          </ul>
        </section>
      </div>
    </div>
  );
};

export default TeknikKonular;
